import React from 'react';

export default class Table extends React.Component {

    render(props) {
        return (
            <table>
                <thead>
                    <tr>
                        <th>name</th>
                        <th>last name</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        this.props.user.map((el) =>
                            <tr>
                                <td>{el.fname}</td>
                                <td>{el.lname}</td>
                            </tr>
                        )}
                </tbody>
            </table>
        );
    }
}
